import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { Text, View, Image, StyleSheet } from 'react-native';

import login from './screens/loginScreen';
import signup from './screens/signupScreen';
import profileScreen from './screens/profileScreen';
import settingscreen from './screens/settingScreen';
import FriendsList from './screens/friendsList';
import EditProfile from './screens/editProfile';
import addFriend from './screens/addFriend';
import FriendRequest from './screens/friendRequestScreen';
import friendScreen from './screens/friendScreen';
import viewPost from './screens/viewSinglePost';
import editPost from './screens/editPost';

const Stack = createNativeStackNavigator();
const Tab = createBottomTabNavigator();

function Home() {
  return (
    <Tab.Navigator
      tabBarOptions={{
        showLabel: false,
      }}
    >
      <Tab.Screen
        name="Profile"
        component={profileScreen}
        options={{
          headerShown: false,
          tabBarIcon: ({ focused }) => (
            <View>
              <Image
                source={require('./assets/user.png')}
                resizeMode="contain"
                style={styles.image}
              />
              <Text
                style={{ color: focused ? '#660094' : '#748c94', fontSize: 10 }}
              >
                Profile
              </Text>
            </View>
          ),
        }}
      />

      <Tab.Screen
        name="Friends"
        component={FriendsList}
        options={{
          headerShown: false,
          tabBarIcon: ({ focused }) => (
            <View>
              <Image
                source={require('./assets/friends.png')}
                resizeMode="contain"
                style={styles.image}
              />
              <Text
                style={{ color: focused ? '#660094' : '#748c94', fontSize: 10 }}
              >
                Friends
              </Text>
            </View>
          ),
        }}
      />
      <Tab.Screen
        name="Settings"
        component={settingscreen}
        options={{
          headerShown: true,
          headerTitleAlign: 'center',
          tabBarIcon: ({ focused }) => (
            <View>
              <Image
                source={require('./assets/settings.png')}
                resizeMode="contain"
                style={styles.image}
              />
              <Text
                style={{ color: focused ? '#660094' : '#748c94', fontSize: 10 }}
              >
                Settings
              </Text>
            </View>
          ),
        }}
      />
    </Tab.Navigator>
  );
}

function MyStack() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="login"
          component={login}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="signup"
          component={signup}
          options={{ title: 'Sign up', headerTitleAlign: 'center' }}
        />
        <Stack.Screen
          name="profile"
          component={Home}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="edit"
          component={EditProfile}
          options={{ title: 'Edit', headerTitleAlign: 'center' }}
        />
        <Stack.Screen
          name="add"
          component={addFriend}
          options={{ title: 'Add Friend', headerTitleAlign: 'center' }}
        />
        <Stack.Screen
          name="request"
          component={FriendRequest}
          options={{ title: 'Friend Request', headerTitleAlign: 'center' }}
        />
        <Stack.Screen
          name="friendScreen"
          component={friendScreen}
          options={{ headerShown: true }}
        />

        <Stack.Screen
          name="viewPost"
          component={viewPost}
          options={{ headerShown: false }}
        />

        <Stack.Screen
          name="editPost"
          component={editPost}
          options={{ headerShown: true }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default MyStack;

const styles = StyleSheet.create({
  image: {
    width: 25,
    height: 25,
  },
});
